import React from "react";
import Knob from "./../../common/Knob/Knob";
import "./eq-knob.scss";


const EqKnob = props =>{
    return (
        <Knob className="eq-knob" unsymetric={{positive:4}} showValue scale={10} quantize={{negative: 3, positive:0.5}} onChange={ props.onChange }/>
    )
}

export default EqKnob;
